import React,{useState,useEffect} from "react";
// import Albums from "../mainSpace/album";
// import Artists from "../mainSpace/artists";
// import Favorites from "../mainSpace/favorites";
// import image from "../..//Photos/image.png"
// import AlbumSongs from "../albumComponent/albumSongs";

// Import icons.
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser } from '@fortawesome/free-solid-svg-icons' 

function MainSpace (user) {
    return(
        <div className="">
            <div>
                {(user.photo) ? 
                    <div>
                    </div>
                    :
                    <div className="bg-gradient-to-r from-black-200 to-blue-300 flex justify-center items-center border-2 border-black-500 rounded-full m-10 w-32 h-32 p-7">  
                        <FontAwesomeIcon icon={faUser} className="text-5xl text-white" />
                    </div>
                }
            </div>
        </div>
    )
}

export default MainSpace
